	ONG.relFlox.generattorPDF = function() {
		var cc = $("#tipoCC").val();
		var de = $("#datade").val();
		var ate = $("#dataate").val();
		
		if(cc == "" && de == "" && ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período, para gerar o relatório.");
			return false;
		} else if(cc == "" || de == "" || ate == ""){
			bootbox.alert("Selecione um Centro de Custo e o Período, para gerar o relatório.");
			return false;
		}
		
		var d = new Date(de.split("/").reverse().join("-"));
		de = d.getTime();
		d = new Date(ate.split("/").reverse().join("-"));
		ate = d.getTime();
		
		var fdatade= $("#datade").val().split('-').reverse().join('/');
		var fdataate = $("#dataate").val().split('-').reverse().join('/');
		
    	ONG.fluxoCaixaRest.pesquisarPeriodoCC({
			data : de+"/"+ate+"/"+parseInt(cc),
			success: function(listPesq){													
				ONG.relFlox.montapdf( listPesq, fdatade,fdataate );
			},
			error: function(err){							
				bootbox.alert("Erro ao gerar relatório, entrar em contato com o Administrador se o problema persistir!");
			}
		});			
	}
